#navbar-main #navbar #nav-xshop {
  overflow: hidden;
  & .nav-ul .nav-li .nav-div .nav-a { color: rgb(255, 255, 255); }
  & #nav-hamburger-menu .hm-icon-label { color: rgb(255, 255, 255); }
  & .nav-ul .nav-li .nav-div .nav-a:focus { color: rgb(204, 204, 204); }
}

#navbar-main #navbar #nav-search {
  & .nav-search-scope { background-color: rgb(230, 230, 230); border-left: 1px solid rgb(230, 230, 230); border-top: 1px solid rgb(230, 230, 230); border-bottom: 1px solid rgb(230, 230, 230); }
  & .nav-search-scope:hover, & .nav-search-scope:focus, & .nav-search-scope.nav-focus { background-color: rgb(212, 212, 212); border-left-color: rgb(212, 212, 212); border-top-color: rgb(212, 212, 212); border-bottom-color: rgb(212, 212, 212); }
  & .nav-searchbar.nav-active, & .nav-searchbar.nav-focus { box-shadow: rgb(255, 153, 0) 0px 0px 0px 2px, rgba(255, 153, 0, 0.5) 0px 0px 0px 3px; z-index: 1; }
  & .nav-searchbar.nav-active .nav-search-scope, & .nav-searchbar.nav-focus .nav-search-scope, & .nav-searchbar.nav-active .nav-search-field, & .nav-searchbar.nav-focus .nav-search-field { border-top: 1px solid rgb(254, 189, 105); border-bottom: 1px solid rgb(254, 189, 105); }
  & .nav-searchbar.nav-active .nav-search-scope, & .nav-searchbar.nav-focus .nav-search-scope { border-left: 1px solid rgb(254, 189, 105); }
  & .nav-search-submit { background-color: rgb(254, 189, 105); }
  & .nav-search-submit:hover, & .nav-search-submit:focus, & .nav-search-submit.nav-focus { background-color: rgb(243, 168, 71); }
}

